using System;
using Inasync;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace AuthorizedBuyersHelpers.Tests {

    [TestClass]
    public class ABCryptoTests {

        [TestMethod]
        public void Ctor() {
            Action TestCase(int testNumber, IABCryptoKeys keys, Type expectedExceptionType = null) => () => {
                new TestCaseRunner($"No.{testNumber}")
                    .Run(() => new ABCrypto(keys))
                    .Verify((_, __) => { }, expectedExceptionType);
            };

            new[] {
                TestCase( 0, null                  , typeof(ArgumentNullException)),
                TestCase( 1, new StubABCryptoKeys())
            }.Run(parallelPerAction: 10);
        }

        [TestMethod]
        public void Dispose() {
            var crypto = new ABCrypto(new StubABCryptoKeys(
                  eKey: Base64Url.Decode("sIxwz7yw62yrfoLGt12lIHKuYrK_S5kLuApI2BQe7Ac=")
                , iKey: Base64Url.Decode("v3fsVcMBMMHYzRhi7SpM0sdqwzvAxM6KPTu9OtVod5I=")
            ));
            crypto.TryDecryptPrice(crypto.EncryptPrice(default), out _);

            new TestCaseRunner()
                .Run(() => crypto.Dispose())
                .Verify(_ => { }, (Type)null);
        }

        [TestMethod]
        public void Encrypt() {
            Action TestCase(int testNumber, byte[] plainBytes, byte[] inputIV, int cipherByteLength, (int bytesWritten, byte[] cipherBytes) expected, Type expectedExceptionType = null) => () => {
                var cipherBytes = new byte[cipherByteLength];
                int bytesWritten = default;
                new TestCaseRunner($"No.{testNumber}")
                    .Run(() => {
                        _crypto.Encrypt(plainBytes, inputIV, cipherBytes, out bytesWritten);
                        return (cipherBytes, bytesWritten);
                    })
                    .Verify((actual, desc) => {
                        actual.bytesWritten.Is(expected.bytesWritten, desc);
                        actual.cipherBytes.Is(expected.cipherBytes, desc);
                    }, expectedExceptionType);
            };

