        [TestMethod]
        public void TryEncrypt() {
            Action TestCase(int testNumber, byte[] plainBytes, byte[] inputIV, int cipherByteLength, (bool success, int bytesWritten, byte[] cipherBytes) expected) => () => {
                var cipherBytes = new byte[cipherByteLength];

                new TestCaseRunner($"No.{testNumber}")
                    .Run(() => (success: _crypto.TryEncrypt(plainBytes, inputIV, cipherBytes, out var bytesWritten), cipherBytes, bytesWritten))
                    .Verify((actual, desc) => {
                        actual.success.Is(expected.success, desc);
                        actual.bytesWritten.Is(expected.bytesWritten, desc);
                        if (actual.success) {
