        [TestMethod]
        public void TryDecrypt() {
            Action TestCase(int testNumber, byte[] cipherBytes, int plainBytesLength, (bool success, int bytesWritten, byte[] plainBytes) expected) => () => {
                var plainBytes = new byte[plainBytesLength];

                new TestCaseRunner($"No.{testNumber}")
                    .Run(() => (success: _crypto.TryDecrypt(cipherBytes, plainBytes, out var bytesWritten), plainBytes, bytesWritten))
                    .Verify((actual, desc) => {
                        actual.success.Is(expected.success, desc);
                        actual.bytesWritten.Is(expected.bytesWritten, desc);
                        if (actual.success) {
                            actual.plainBytes.Is(expected.plainBytes, desc);
                        }
                    }, (Type)null);
            };

            new[] {
                TestCase( 0, new byte[0]                                                                 , 0 , (false, 0 , default)),
                TestCase( 1, Base64Url.Decode("OG46wAAMCggBI0VniavN7-mMyUZXP79GV5XMEA==")                , 7 , (false, 0 , default)),
                TestCase( 2, Base64Url.Decode("OG46wAAMCggBI0VniavN7-mMyUZXP79GV5XMEA==")                , 8 , (true , 8 , new byte[]{ 0,1,2,3,4,5,6,7 })),
                TestCase( 3, Base64Url.Decode("OG46wAAMCggBI0VniavN7-mMyUZXP79FV5XMEA==")                , 8 , (false, 0 , default)),  // ペイロード改竄。
